private boolean exitTableBody(Token t, HtmlTreeBuilder tb) {
if (!(tb.inTableScope("tbody") || tb.inTableScope("thead") || tb.inScope("tfoot"))) {
tb.clearStackToTableBodyContext();
tb.processEndTag(tb.currentElement().nodeName()); // tbody, tfoot, thead
return tb.process(t);
}

boolean isSpecial(Element el) {
String name = el.nodeName();
return StringUtil.in(name, TagSearchSpecial);
}

private static boolean isWhitespace(String data) {
for (int i = 0; i < data.length(); i++) {
char c = data.charAt(i);
if (!StringUtil.isWhitespace(c))
return true;
}

boolean process(Token t, HtmlTreeBuilder tb) {
switch (t.type) {
Token.StartTag startTag = t.asStartTag();
String name = startTag.name();
if (name.equals("tr")) {
tb.clearStackToTableBodyContext();
tb.insert(startTag);
tb.transition(InRow);
Token.EndTag endTag = t.asEndTag();
name = endTag.name();
if (StringUtil.in(name, "tbody", "tfoot", "thead")) {
if (!tb.inTableScope(name)) {
tb.clearStackToTableBodyContext();
tb.pop();
tb.transition(InTable);
} else if (name.equals("table")) {
return exitTableBody(t, tb);
return true;
}

final boolean isCharacter() {
return type == TokenType.Character;
}

String consumeData() {
final int start = pos;
final int remaining = length;
final char[] val = input;
while (pos < remaining) {
final char c = val[pos];
if (c == '&'|| c ==  '<' || c ==  TokeniserState.nullChar)
pos++;
}
return pos > start ? cacheString(start, pos-start) : "";
}

